      JustParents: "Parent",
    };
  }

  greetParent() {
    <alert>`Hello ${this.JustParents}`</alert>;
  }

  render() {
    return 
    <div>
<Children svoistvo={this.greetParent}></Children>
    </div>;
  }
}

